import sys

def gcd(a, b):
    while b:
        a, b = b, a % b
    return a

def lcm(a, b):
    return a * b // gcd(a, b)

def main():
    n = int(input())
    t = [int(input()) for i in range(n)]
    ans = t[0]
    for i in range(1, n):
        ans = lcm(ans, t[i])
    print(ans)

if __name__ == '__main__':
    main()

